export function getShaderNoiseTexture(texture = 0): HTMLImageElement {
  if (typeof window === 'undefined') {
    throw new Error('Paper Shaders: canâ€™t create a texture on the server');
  }

  let src = '';
  if (texture === 0) {
    // RGB randomizer
    src =
      'data:image/png;base64,';
  } else if (texture === 1) {
    // pulsing signal
    src =
      'data:image/png;base64,';
  }

  const img = new Image();
  img.src = src;
  return img;
}
